O Departamento de Morfologia e Patologia utiliza microscópios ópticos em aulas práticas de disciplinas fundamentais da área da saúde e ciências biológicas.
Atualmente, 7 desses equipamentos apresentam desgaste natural devido ao uso contínuo por estudantes e docentes, o que compromete a qualidade da imagem, o foco e
a funcionalidade geral dos aparelhos.
A ausência de revisão técnica, limpeza interna e externa e o ajuste adequado de lentes e sistemas mecânicos pode resultar em:
Imagens de baixa qualidade, prejudicando a observação de lâminas histológicas;
Dificuldade de manuseio por parte dos alunos, comprometendo o aprendizado;
Risco de danos permanentes por uso inadequado de equipamentos desregulados;
Redução da vida útil dos microscópios, implicando em maior custo com reposições futuras.
Caso o serviço não seja realizado, os seguintes prejuízos podem ocorrer:
Comprometimento do processo de ensino-aprendizagem nas disciplinas práticas;
Reclamações recorrentes de alunos e professores quanto à qualidade dos equipamentos;
Aumento no risco de falhas e necessidade de substituição prematura de peças ou dos próprios microscópios;
Possível descontinuidade temporária de aulas práticas por falta de equipamentos funcionais
